//
//	{
//	    "type": "s3",
//	    "endpoint": "https://gateway.storjshare.io",
//	    "credentials": {
//	        "accessKeyId": "$ACCESS_KEY_ID",
//	        "secretAccessKey": "$SECRET_ACCESS_KEY"
//	    },
//	    "bucket": "inbucket",
//	    "path": "/video/source.mp4"
//	}
//
// ```
//
